import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import {
  Container,
  Row,
  Col
} from 'react-bootstrap';
import Nav from 'react-bootstrap/Nav';
// import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button'




function NavBar() {
  return ( 
  <Container >
    <Row >

    <Col className="nav-primary"xs = {6} md = {4} >
    <Navbar bg = "light" expand = "lg" >
    <Container > {
      /* <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" /> */
    } <Navbar.Collapse id = "basic-navbar-nav" >
    <Nav className = "me-auto" >
    <Nav.Link href="/about"> ABOUT US </Nav.Link>
    <Nav.Link href = "/rescue" > RESCUE </Nav.Link> 
    <Nav.Link href = "/foster" > FOSTER </Nav.Link> 
    </Nav> 
    </Navbar.Collapse> 
    </Container> 
    </Navbar> 
    </Col> 
    <div className="title-area">
    <a href="/"><img src="https://sarama.org/wp-content/uploads/2018/01/SARAMA_logo_160x110.png" /> </a>
    <Nav.Link href="/" > <h3> Sarama </h3> </Nav.Link> 

    </div>
    <Col className=" third-menu"xs = {6} md = {4} > 
    <Navbar bg = "light" expand = "lg" >
    <Container > {
      /* <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" /> */
    } <Navbar.Collapse id = "basic-navbar-nav" >
    <Nav className = "me-auto" >
    <Nav.Link href = "/shop" > SHOP </Nav.Link> 
    <Nav.Link href = "/waystohelp" > WAYS TO HELP </Nav.Link> 
    <Button variant = "success" href="/donate"> Donate </Button> 
    </Nav> 
    </Navbar.Collapse> 
    </Container> 
    </Navbar> 
    </Col> 
    </Row>
    </Container>

  )
}

export default NavBar;
